import React from 'react';
import {BrowserRouter, Routes, Route} from "react-router-dom";

const App = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path={"/"} element={<Home />}></Route>
                <Route path={"/a-propos"} element={<Movies />}></Route>
                <Route path={"/a-propos"} element={<Series />}></Route>
                <Route path={"*"} element={<NotFound />}></Route>
            </Routes>
        </BrowserRouter>
    )
};

export default App;
